import React, {Component} from "react";
import classes from "./Landing.module.css";
import Linda from './images/lindaWooHeadShot.jpeg';
import Rezoom from './images/rezoom.jpeg';

class Landing extends Component {

    render(){


        return(
            <div className = {classes.Landing}>
                <div className = {classes.Heading}>
                    <p>Linda Woo</p>
                    <span>Frontend Software Developer</span>
                    <img className = {classes.Linda} src = {Linda} />
                </div>
                <div className = {classes.Projects}>
                    <img src = {Rezoom} />
                </div>
                <div className = {(classes.Skills,classes.JavaScript)}>
                    JavaScript
                </div>
                <div className = {classes.Skills,classes.React}>
                    ReactJS
                </div>
                <div className = {classes.Skills, classes.Html}>
                    HTML
                </div>
                <div className = {classes.Skills, classes.Css}>
                    CSS
                </div>
                <div className = {classes.Skills, classes.JQuery}>
                    JQuery
                </div>
            </div>
        )


    }


}

export default Landing;
